import React from 'react';
import './Textcontent.css';

const Textcontent = (route) => {
    console.log(route);
    switch (route){
        case "/one" : return(<div className='Textcontent'>
                                <p>this is one</p>
                            </div>);

        case "/two" : return(<div className='Textcontent'>
                                <p>this is two</p>
                            </div>);

        default : return(<div className='Textcontent'>
                            <p>Hello</p>
                        </div>);
                        }

};

export default Textcontent;
